class Solution {
public:
    /**
     * @param root: A Tree
     * @return: Postorder in ArrayList which contains node values.
     */
    vector postorderTraversal(TreeNode * root) {
        // write your code here

        if (!root) {
            return {};
        }

        std::vector ans;
        std::stack stk;
        findSuccessor(root, stk);

        while (!stk.empty()) {

            auto curr = stk.top();
            stk.pop();

            ans.push_back(curr->val);

            if (!stk.empty()) {
                if (stk.top()->left == curr) {
                    findSuccessor(stk.top()->right, stk);
                }
            }
        }

        return ans;
    }

private:
    void findSuccessor(TreeNode* root, std::stack& stk) {

        while (root) {
            stk.push(root);

            if (root->left) {
                root = root->left;
            } else {
                root = root->right;
            }
        }
    }
};

